import React from "react";

const Sidebar = ()=>{
    return (
        <Drawer
            variant="permanent"
            anchor="left"
          >
            <Box className={classes.toolbar}/>
            <Divider/>
            <Box 
            display='inline-flex'
            my='1rem'
            sx={{
              
              flexDirection:'row',
              justifyContent: 'space-around',
              alignItems:'center'
            }}
            onClick={goToProfile}
            >
              <Uavatar/>
              <UserName />
            </Box>
            <Divider />
            <List>
              {['All Articles','Add', 'Drafts', 'Trash','logout'].map((text, index) => (
                <ListItem button key={text}>
                  <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon>
                  <ListItemText primary={text} />
                </ListItem>
              ))}
            </List>
          </Drawer>
    )
}
export default Sidebar;
